import React from 'react';

const App = () => {
  const livros = [
    { nome: 'A Game of Thrones', ano: 1996 },
    { nome: 'A Clash of Kings', ano: 1998 },
    { nome: 'A Storm of Swords', ano: 2000 },
  ];
  return (
    <ul>
      {livros.map( (item) => (
        <li key="item.nome"> Livro: {item.nome}; Lançado em {}</li>
      ))}
    </ul>
  );
};


export default App;
